//ELEMENT

$(function() {

	//TOOLTIP
	$.cms.toolTip();

	//FANCYBOX
	$.cms.fancyBox();

	//COUNT
	$.cms.count20();
	
	//ENABLE CKEDITOR
	$.ck.CKEditor();

	//ENABLE MARKITUP
	$.ck.MarkItUp();

	//SAVE AND CONTINUE
	$.cms.saveContinue();

	//MODAL MEDIA EVENT
	$.cms.openMediaModal();

	//UPLOAD MEDIA
	$.cms.uploadMedia();

	//LISTENER as_html
	$.ck.CKasHtml();

	//LISTENER as_html
	$.ck.CKasText();

	//SORTABLE LIST ELEMENT
	$.cms.sortableListElement();

});